      <main className="main-content">
        <section className="welcome-section">
          <h2>Welcome to the CPP Coding Club</h2>
          <p>
            Join us to enhance your problem-solving skills through coding contests and challenges. Participate in
            weekly and bi-daily contests to prove your mettle, rise up the leaderboards, and improve continuously.
          </p>

          {/* Use the Contests component here */}
          {/* <Contests /> */}
        </section>
      </main>

      <footer>
        <p>&copy; 2024 CPP Coding Club | Contact: cppclub@example.com</p>
      </footer>
    </div>
  );
};

export default Home;
